import React from "react";

import pic from "../assets/img/cardPIC.png";

const Cardite = () => {
  return (
    <div style={{ padding: "10px" }}>
      <div>
        <img src={pic} alt="pic" />
        <h3>amir hussein</h3>
        <p>Lorem ipsum dolor sit amet consectetur</p>
      </div>
    </div>
  );
};

export default Cardite;
